import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Customers from './components/customers/customer';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <Customers />
        </header>
        <iframe width="560" height="315" src="https://www.youtube.com/embed/xPiprkwzEWU?autoplay=1" frameborder="0" allow="autoplay; encrypted-media" style="margin:0;"height="0" allowfullscreen></iframe>
      </div>
    );
  }
}

export default App;
